import React from "react";
import LanguageBarChart from "./LanguageBarChart";
import LanguageTable from "../components/LanguageTable";
import OverallLanguageRank from "./components/OverallLanguageRank";

const Main = () => {
  return (
    <div>
      <h1>Language Trends Dashboard</h1>
      {/* 전체 언어 순위 차트 */}
      <section>
        <h2>Overall Language Trends</h2>
        <LanguageBarChart />
      </section>

      {/* 언어 테이블 */}
      <section>
        <h2>Language Details</h2>
        <LanguageTable />
      </section>

      {/* 종합 언어 순위 */}
      <section>
        <h2>Top Languages by Trend</h2>
        <OverallLanguageRank />
      </section>
    </div>
  );
};

export default Main;
